  MALFORMED_RANGE(-6),
  RANGE_OVERLAP(-7),
  NOT_FOUND(-8),
  SUB_TYPE_NOT_EXIST(-9),
  INVALID_FEE_VERSION(-10),
  INVALID_FEE_ASSET(-11),
  FEE_ASSET_NOT_ALLOWED(-12),
