  FEE_ASSET_NOT_FOUND(-14),
  ASSET_PAIR_NOT_FOUND(-15),
  INVALID_ASSET_PAIR_PRICE(-16),
  INVALID_FEE_HASH(-17),
  INVALID_AMOUNT_PRECISION(-18),
