open class DecoratedSignature(
    var hint: org.tokend.wallet.xdr.SignatureHint,
    var signature: org.tokend.wallet.xdr.Signature
  ) : XdrEncodable {

  override fun toXdr(stream: XdrDataOutputStream) {
    hint.toXdr(stream)
    signature.toXdr(stream)
  }
}
